import React from 'react'

function AppTodoList({ SetMyList, myList }) {
    console.log(myList)
    return (
    <div>

        {myList.map((index, value) => (
            <div key={index}> {value} </div>
        ))}
    </div>
  )
}

export default AppTodoList
